import "./App.css";
import Homepage from "./homepage.js";
import Browse from "./browse.js";

function App() {
  return (
    <div className="App">
      <Homepage />
      <Switch>
        <Route exact path="/" component={Homepage} />
        <Route exact path="/Products" component={Browse} />
      </Switch>
    </div>
  );
}

export default App;
